-- ----------------------------
--  Table structure for `sys_login_log`
-- ----------------------------
DROP TABLE IF EXISTS `sys_login_log`;
CREATE TABLE `sys_login_log` (
  `id` varchar(32) COLLATE utf8mb4_bin NOT NULL,
  `log_name` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '日志名称',
  `user_name` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '用户名',
  `login_date` datetime DEFAULT NULL COMMENT '登录时间',
  `is_success` varchar(1) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '是否成功',
  `message` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '消息',
  `ip` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'ip',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='登录日志';

-- ----------------------------
--  Table structure for `sys_mail_verifies`
-- ----------------------------
DROP TABLE IF EXISTS `sys_mail_verifies`;
CREATE TABLE `sys_mail_verifies` (
  `id` varchar(32) COLLATE utf8mb4_bin NOT NULL,
  `user_id` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '用户标识/user_id/username',
  `mail` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '邮箱',
  `code` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '效验码',
  `expired` datetime DEFAULT NULL COMMENT '过期时间',
  `type` varchar(2) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '类型',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='邮箱验证';

-- ----------------------------
--  Table structure for `sys_message`
-- ----------------------------
DROP TABLE IF EXISTS `sys_message`;
CREATE TABLE `sys_message` (
  `id` varchar(32) COLLATE utf8mb4_bin NOT NULL COMMENT 'id',
  `title` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '标题',
  `subtitle` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '副标题(保留字段)',
  `content` text COLLATE utf8mb4_bin COMMENT '内容',
  `status` int(2) DEFAULT NULL COMMENT '状态',
  `send_date` datetime DEFAULT NULL COMMENT '发送时间',
  `icon` varchar(20) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '图标(保留字段)',
  `important` int(2) DEFAULT NULL COMMENT '重要',
  `type` varchar(10) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '类型',
  `version` int(11) DEFAULT NULL COMMENT '乐观锁',
  `create_user` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '创建人',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `edit_user` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '更新人',
  `edit_date` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='通知 ';

-- ----------------------------
--  Records of `sys_message`
-- ----------------------------
BEGIN;
INSERT INTO `sys_message` VALUES ('3feaf2622e06393ec1c03a53a7e0f365', '请绑定密保手机', null, '<p><font color=\"#646c9a\">请在个人中心&gt;安全设置中绑定密保手机。密保手机可以进行帐号登录、找回密码等敏感操作的安全验证，请勿随意泄露手机号、短信验证码，以防不法分子利用造成个人损失</font><br></p>', '1', '2019-06-16 21:18:30', null, '1', 'notice', null, '126', '2019-06-16 21:18:30', '126', '2019-06-16 21:18:30'), ('9fcd12b3864534454473a46109cc9640', '请绑定密保邮箱', null, '<p>请在个人中心&gt;安全设置中绑定密保邮箱。密保邮箱可以进行帐号登录、找回密码等敏感操作的安全验证，请勿泄露邮箱信息，轻信他人邮件，以防不法分子利用造成个人损失。</p>', '1', '2019-06-16 21:17:36', null, '1', 'notice', null, '126', '2019-06-16 21:17:36', '126', '2019-06-16 21:17:36');
COMMIT;

-- ----------------------------
--  Table structure for `sys_message_details`
-- ----------------------------
DROP TABLE IF EXISTS `sys_message_details`;
CREATE TABLE `sys_message_details` (
  `id` varchar(32) COLLATE utf8mb4_bin NOT NULL COMMENT 'id',
  `message_id` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '消息id',
  `receiver_user` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '接收人',
  `read_date` datetime DEFAULT NULL COMMENT '阅读时间',
  `status` int(2) DEFAULT NULL COMMENT '状态',
  `star` int(1) DEFAULT NULL COMMENT '是否被标记※',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='消息详情 ';

