--  Records of `sys_message_details`
-- ----------------------------
BEGIN;
INSERT INTO `sys_message_details` VALUES ('14b2a68b599d4b459c0a5ddb7c494a6a', '9fcd12b3864534454473a46109cc9640', '126', null, '0', '1'), ('44480978b8b54a786fb53f62f6e3b8b5', '3feaf2622e06393ec1c03a53a7e0f365', '126', '2019-06-18 22:32:27', '1', '0');
COMMIT;

-- ----------------------------
--  Table structure for `sys_permissions`
-- ----------------------------
DROP TABLE IF EXISTS `sys_permissions`;
CREATE TABLE `sys_permissions` (
  `id` varchar(32) NOT NULL,
  `code` varchar(50) DEFAULT NULL COMMENT '权限标识',
  `p_code` varchar(50) DEFAULT NULL COMMENT '父权限标识',
  `p_codes` varchar(255) DEFAULT NULL COMMENT '当前权限所有父权限标识',
  `name` varchar(50) DEFAULT NULL COMMENT '权限名称',
  `icon` text COMMENT '图标',
  `url` varchar(255) DEFAULT NULL COMMENT '权限地址',
  `order_no` int(3) DEFAULT NULL COMMENT '排序值',
  `levels` int(1) DEFAULT NULL COMMENT '级别',
  `type` int(1) DEFAULT NULL COMMENT '类型',
  `status` int(1) DEFAULT NULL COMMENT '状态',
  `is_open` int(1) DEFAULT NULL COMMENT '是否默认打开',
  `tips` varchar(255) DEFAULT NULL COMMENT '备注',
  `create_user` varchar(32) DEFAULT NULL COMMENT '创建人',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `edit_user` varchar(32) DEFAULT NULL COMMENT '编辑人',
  `edit_date` datetime DEFAULT NULL COMMENT '编辑时间',
  `version` int(5) DEFAULT NULL COMMENT '乐观锁保留字段',
  `p_id` varchar(32) DEFAULT NULL COMMENT '父权限id',
  `color` varchar(10) DEFAULT NULL COMMENT '字体颜色',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='权限/菜单';

