-- ----------------------------
--  Table structure for `sys_task`
-- ----------------------------
DROP TABLE IF EXISTS `sys_task`;
CREATE TABLE `sys_task` (
  `id` varchar(32) COLLATE utf8mb4_bin NOT NULL COMMENT 'id',
  `title` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '标题',
  `content` text COLLATE utf8mb4_bin COMMENT '内容',
  `str_date` datetime DEFAULT NULL COMMENT '开始时间',
  `end_date` datetime DEFAULT NULL COMMENT '结束时间',
  `url` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '任务url',
  `receiver` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '接收人',
  `status` int(2) DEFAULT NULL COMMENT '状态',
  `release_date` datetime DEFAULT NULL COMMENT '发布时间',
  `version` int(11) DEFAULT NULL COMMENT '乐观锁',
  `create_user` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '创建人',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `edit_user` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '更新人',
  `edit_date` datetime DEFAULT NULL COMMENT '更新时间',
  `code` varchar(10) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '任务代码',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='任务 ';

-- ----------------------------
--  Table structure for `sys_user`
-- ----------------------------
DROP TABLE IF EXISTS `sys_user`;
CREATE TABLE `sys_user` (
  `id` varchar(32) NOT NULL,
  `username` varchar(50) DEFAULT NULL COMMENT '用户名',
  `password` varchar(32) DEFAULT NULL COMMENT '密码',
  `salt` varchar(20) DEFAULT NULL COMMENT 'md5密码盐',
  `nickname` varchar(50) DEFAULT NULL COMMENT '昵称',
  `sex` int(1) DEFAULT NULL COMMENT '性别',
  `email` varchar(50) DEFAULT NULL COMMENT '邮箱',
  `phone` varchar(50) DEFAULT NULL COMMENT '手机号',
  `birthday` date DEFAULT NULL COMMENT '生日',
  `dept_id` varchar(32) DEFAULT NULL COMMENT '部门id',
  `status` int(1) DEFAULT NULL COMMENT '状态(1.正常 2.冻结 0.已删除)',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `last_login` datetime DEFAULT NULL COMMENT '最后登录时间',
  `avatar` varchar(255) DEFAULT NULL COMMENT '头像',
  `version` int(11) DEFAULT NULL COMMENT '乐观锁保留字段',
  `create_user` varchar(32) DEFAULT NULL COMMENT '创建人',
  `edit_user` varchar(32) DEFAULT NULL COMMENT '编辑人',
  `edit_date` datetime DEFAULT NULL COMMENT '编辑时间',
  `source` int(2) DEFAULT NULL COMMENT '用户来源',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户';

