-- ----------------------------
--  Table structure for `sys_user_setting`
-- ----------------------------
DROP TABLE IF EXISTS `sys_user_setting`;
CREATE TABLE `sys_user_setting` (
  `id` varchar(32) COLLATE utf8mb4_bin NOT NULL COMMENT '用户id',
  `tip_type` varchar(2) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '提示类型',
  `themes` varchar(2) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '主题',
  `fixed_footer` varchar(2) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '固定footer',
  `allow_aside_minimizing` varchar(2) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '默认收起菜单',
  `fixed_header` varchar(2) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '固定头部',
  `page_loader` varchar(2) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '页面loader',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='用户偏好设置';

-- ----------------------------
--  Table structure for `sys_workflow`
-- ----------------------------
DROP TABLE IF EXISTS `sys_workflow`;
CREATE TABLE `sys_workflow` (
  `id` varchar(32) COLLATE utf8mb4_bin NOT NULL COMMENT 'id',
  `business_code` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '业务代码',
  `business_name` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '业务名称',
  `process_id` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '流程id',
  `model_id` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '模型id',
  `tips` text COLLATE utf8mb4_bin COMMENT '备注',
  `status` int(2) DEFAULT NULL COMMENT '状态',
  `version` int(11) DEFAULT NULL COMMENT '乐观锁',
  `create_user` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '创建人',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `edit_user` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '更新人',
  `edit_date` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='工作流 ';

SET FOREIGN_KEY_CHECKS = 1;
